import React from "react";
import { Link } from "react-router-dom";

const Home = () => {
  return (
    <>
      <div className="m-auto">
        <h1>Welcome</h1>
        <Link to='/user/modify-password'>Modify password</Link> <br />
        <Link to='/cart/checkout'>Checkout</Link> <br />
        <Link to='/success'>Success</Link> <br />
      </div>
    </>
  );

};

export default Home;
